import {Col, Form} from 'react-bootstrap';

const MoviePref = () =>{
    return(
        <Form>
        <Form.Row>
          <Col>
            <Form.Control placeholder="First name" />
          </Col>
          <Col>
            <Form.Control placeholder="Last name" />
          </Col>
        </Form.Row>
      </Form>
    );
};
export default MoviePref;
